import React from "react";

function a(sent)
{
	return (
	<form>
		<div>
			<input type="checkbox" /><br />
			<label>Service #1</label><br />
			<input type="submit" onClick={sent = new Boolean(false)} /><br />
		</div>
	</form>);
}

function b() {
	return <>hello world</>;
}

export function App() {
	const sent = new Boolean(true);
	return (sent ? a(sent) : b());
}

export default App;
